I would like to add my suggestions: Perhaps it is worth assigning the responsibility to validators:

1. register each new participant received from each miner;
2. verify and confirm the rating of each participant;
3. Randomly redistribute the work of participants on different miners, i.e. a participant performs tasks for the appointment of a validator for different miners randomly.
4. Assign additional weight to the miner for each well-working participant that this miner brought to the project (at the same time, the participant also performs tasks for other miners as assigned by the validator randomly);

These are just some of my suggestions for now. After some time, I will outline my suggestions on this matter in more detail.

